import { useState } from 'react';
import styled from 'styled-components';
import Items from './Items';
import { Badge } from '@material-ui/core';
import { ShoppingCartOutlined } from '@material-ui/icons';
import { useSelector } from 'react-redux';
function App() {
	const quantity = useSelector((state) => state.products.quantity);
	const data = [
		{
			id: 1,
			image: 'https://picsum.photos/200/',
			title: 'cart',
			amount: '100',
		},
		{
			id: 2,
			image: 'https://picsum.photos/200/',
			title: 'cart',
			amount: '100',
		},
		{
			id: 3,
			image: 'https://picsum.photos/200/',
			title: 'cart',
			amount: '100',
		},
		{
			id: 4,
			image: 'https://picsum.photos/200/',
			title: 'cart',
			amount: '100',
		},
		{
			id: 5,
			image: 'https://picsum.photos/200/',
			title: 'cart',
			amount: '100',
		},
		{
			id: 6,
			image: 'https://picsum.photos/200/',
			title: 'cart',
			amount: '100',
		},
		{
			id: 7,
			image: 'https://picsum.photos/200/',
			title: 'cart',
			amount: '100',
		},
		{
			id: 8,
			image: 'https://picsum.photos/200/',
			title: 'cart',
			amount: '100',
		},
		{
			id: 9,
			image: 'https://picsum.photos/200/',
			title: 'cart',
			amount: '100',
		},
		{
			id: 10,
			image: 'https://picsum.photos/200/',
			title: 'cart',
			amount: '100',
		},
	];
	const [product, setProduct] = useState(data);

	return (
		<Wrap>
			<Carting>
				<MenuItem>
					<Badge badgeContent={quantity} color='primary'>
						<ShoppingCartOutlined />
					</Badge>
				</MenuItem>
			</Carting>
			<Wrapper>
				{product.map((data) => (
					<Items
						key={data.id}
						id={data.id}
						title={data.title}
						amount={data.amount}
						image={data.image}
						items={data}
					/>
				))}
			</Wrapper>
		</Wrap>
	);
}

const Wrap = styled.div`
	max-width: 1440px;
	width: 100%;
	display: flex;

	flex-direction: column;
`;

const Carting = styled.div`
	font-size: 10rem;
	display: flex;
	width: 100%;
`;

const Wrapper = styled.div`
	display: grid;
	width: 100%;
	grid-template-columns: 1fr 1fr 1fr;
	grid-gap: 2rem;
`;

const MenuItem = styled.div`
	font-size: 4rem;
	cursor: pointer;
	width: 100%;
	margin-left: 25px;
`;
export default App;
